pragma solidity >=0.7.6;








contract HashToken is ERC20, Ownable {
    using SafeMath for uint256;
    string private _name = 'HASH';
    string private _symbol = 'HASH';
    address private feeAddress = 0x0EBB21A1829854118B441e3f0A8894a350faB456;//手续费基金会地址
    address private thePotAddress = 0xC5D3FA87fc7104F1e6E5DcF37b7d5008E1344f87;//; // 底池地址

    address private  pairContractAddress;
    address private  castingAddress; //铸造着地址
    uint public sellRate = 5; //卖出手续费百分比
    uint8 decimal = 18;
    uint256 private _totalSupply = 200000 * 10 ** decimal; //发币总量
    uint256 private mintTotalSupply = 20999800000 * 10 ** decimal;
    uint256 public  publishedTotalSupply = 0;
    address private usdtContractAddress = 0x55d398326f99059fF775485246999027B3197955;
    address private routerAddress = 0x10ED43C718714eb63d5aA57B78B54704E256024E;//0x10ED43C718714eb63d5aA57B78B54704E256024E;
    mapping (address => bool) private _isExcludedFromFees;
    uint public  num = 0;
    IERC20 public usdtToken;    
    uint256 private _lastQuotedPriceTs;
    uint256 private _todayInitPrice;                                // today init price
    address private _initPoolAddr;        
    mapping (address=>bool) validAddress;                          // The address used to initialize the pool
    IPancakeswapV2Router02 uniswapV2Router_ = IPancakeswapV2Router02(routerAddress);

    constructor() ERC20(_name,_symbol) {
        usdtToken = IERC20(usdtContractAddress);
        pairContractAddress = IPancakeswapV2Factory(uniswapV2Router_.factory()).createPair(address(this), address(usdtToken));
        _mint(thePotAddress, _totalSupply);  //底池
        validAddress[thePotAddress] = true;   
        num = 1; 
        _isExcludedFromFees[thePotAddress] = true;
        _isExcludedFromFees[address(this)] = true;
    }

    modifier onlyCasting() {
        require( _msgSender() == castingAddress,"casting: casting error");
        _;
    }

    event ExcludeFromFees(address account , bool excluded);

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        if(_isExcludedFromFees[account] != excluded){
            _isExcludedFromFees[account] = excluded;
            emit ExcludeFromFees(account, excluded);
        }
    }

    function setCastingAddress(address _address) public onlyOwner{
        castingAddress = _address;
    }

    function setSellTransactionRate(uint _rate) public onlyOwner{
            sellRate = _rate;
    }

    function contractTransfer(address to, uint256 amount) public onlyOwner returns(bool){
        super._transfer(address(this), to, amount);
        return true;
    }

    function getAddressNum() public view returns(uint){
        return num;
    }

    function getPairContractAddress() public view returns(address){
        return pairContractAddress;
    }

    function setPairContractAddress(address _addr) public onlyOwner{
         pairContractAddress = _addr;
    }

    function getAdministratorsAddress() view public returns(address){
        return owner();
    }

    function setAdministratorsAddress(address _addr)  public onlyOwner {
        transferOwnership(_addr);
    }

    function burn(uint256 amount) external {
        _burn(_msgSender(), amount);
    }

    function mint(address account,uint256 amount) external onlyCasting{
        uint256 totalS = publishedTotalSupply.add(amount);
        if(totalS < mintTotalSupply){
            _mint(account, amount);
            publishedTotalSupply += amount;
            if(validAddress[account] != true){
                validAddress[account] = true;   
                num ++;     
            }
        }
    }

    function burnFrom(address from_, uint amount_) external {
        _approve(from_, _msgSender(), allowance(from_, _msgSender()).sub(amount_, "APEDToken: burn amount exceeds balance"));
        _burn(from_, amount_);
    }

   function _transfer(address from,address to,uint256 amount) internal virtual override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        uint256 _amount = amount;//到账金额
       
        if(!_isExcludedFromFees[to] && !_isExcludedFromFees[from]){
             _updateTodayInitPrice();
            if(from == pairContractAddress ){ //买入
                require(num >= 3000 , "Insufficient currency holding address, unable to purchase");
            } else if(to == pairContractAddress){ //卖出
                uint256 totalFee = amount.mul(sellRate).div(100);
                _amount = amount.sub(totalFee); 
                super._transfer(from, feeAddress, totalFee);
            }
        }
        
        if(num > 0){
            if( balanceOf(from) - _amount == 0){
                num --;
                validAddress[from] == false;
            }   
        }
        
       super._transfer(from, to, _amount);
        if(validAddress[to] != true){
            validAddress[to] = true;   
            num ++;     
        }
    }

    function _updateTodayInitPrice() private {
        uint today_ = block.timestamp - block.timestamp % 86400;
        uint256 uintPrice = _getPrice();
        if ( today_ != _lastQuotedPriceTs ) {
            _lastQuotedPriceTs = today_;
            sellRate = 5;
            _todayInitPrice = _getPrice();
        }else{
            if(_todayInitPrice > uintPrice){
                uint256 s = _todayInitPrice - uintPrice;
                uint r = s.div(_todayInitPrice).mul(100);
                if(r > 10){
                    sellRate = 10;
                }
                if(r > 20){
                    sellRate = 20;
                }
                if(r > 30){
                    sellRate = 35;
                }
            }
        }
    }

    function _getPrice() private view returns(uint256){
        if ( IPancakeswapV2Pair(pairContractAddress).totalSupply() == 0 ) {
            return 0;
        }
        address tA_ = address(usdtToken);
        address tB_ = address(this);
        (address t0_,) = tA_ < tB_ ? (tA_, tB_) : (tB_, tA_);
        (uint256 rA_, uint256 rB_,) = IPancakeswapV2Pair(pairContractAddress).getReserves();
        (uint256 r0_, uint256 r1_) = t0_ == tA_ ? (rA_, rB_) : (rB_, rA_);
        uint256 price_ = 0;
        if ( r1_ > 0 ) {
            price_ = r0_.mul(10**18).div(r1_);
        }
        return price_;
    }
    function getPrice() public view returns(uint256,uint256,uint256){
        uint256 price_ = 0;
        uint256 r0_ = 0;
        uint256 r1_ = 0;
         if ( IPancakeswapV2Pair(pairContractAddress).totalSupply() == 0 ) {
            price_ = 0;
            r0_ = 0;
            r1_ = 0;
            return (price_,r0_,r1_);
        }
        address tA_ = address(usdtToken);
        address tB_ = address(this);
        (address t0_,) = tA_ < tB_ ? (tA_, tB_) : (tB_, tA_);
        (uint256 rA_, uint256 rB_,) = IPancakeswapV2Pair(pairContractAddress).getReserves();
        (r0_, r1_) = t0_ == tA_ ? (rA_, rB_) : (rB_, rA_);
        if ( r1_ > 0 ) {
            price_ = r0_.mul(10**18).div(r1_);
        }
        return (price_,r0_,r1_);
    }

}
